import React from "react";

class Discuss extends React.Component {
  render() {
    return (
      <React.Fragment>
        <div id="disqus_thread"></div>
        <script dangerouslySetInnerHTML={this.setDiscuss()}></script>
      </React.Fragment>
    );
  }
}

export default Discuss;
